import React, { useEffect, useState } from 'react'

function Joke(){
  const [ joke, setJoke ] = useState({})

  useEffect( () => {
    // fetch('https://official-joke-api.appspot.com/jokes/random')
    fetch('http://localhost:3005/jokes/random')
      .then(res => res.json())
      .then(json => {
        console.log('joke json', json)
        setJoke(json)
      })
  })

  return (
    <div>
      <h3>Joke</h3>
    </div>
  )
}

export default Joke
